import React, { useState } from "react";
import axios from "axios";
import { Navbar } from "../index";
import "./Claim.css";

const Claim = () => {
  const [formData, setFormData] = useState({
    step: 1,
    claim_ID: "1",
    claim_username: "",
    claim_userSSID: "",
    claim_usertel: "",
    claim_email: "",
    claim_type: "0",
    claim_parcelID: "",
    claim_des: "",
    claim_bankaccount: "0",
    bankAccount: "0",
    claim_banknum: "",
    claim_bankholdername: "",
    claim_bookbank: "",
  });

  const handleChange = (e) => {
    console.log("Event target:", e.target);
    const { name, value } = e.target;
    console.log("Name:", name, "Value:", value);
    setFormData({ ...formData, [name]: value });
  };

  const handleSelectChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleBankChange = (input, e) => {
    if (input === "claim_bankaccount") {
      const value = e.target.value;
      if (value === "6") {
        setFormData({ ...formData, [input]: value, bankAccount: "" });
      } else {
        setFormData({ ...formData, [input]: value });
      }
    } else {
      setFormData({ ...formData, [input]: e.target.value });
    }
  };

  const nextStep = () => {
    setFormData((prevData) => ({
      ...prevData,
      step: prevData.step + 1,
    }));
  };

  const prevStep = () => {
    setFormData((prevData) => ({
      ...prevData,
      step: prevData.step - 1,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData); // Log formData here
    axios
      .post("http://localhost:3333/claim", formData)
      .then((response) => {
        console.log(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  };

  const { step } = formData;

  return (
    <>
      <Navbar />
      <div className="Claim-container">
        <div className="Claim-form-container">
          <form onSubmit={handleSubmit}>
            <h1>Claim Form</h1>
            <br />
            <br />

            <div className="progress-bar">
              <div className="step-indicator">
                <div className={step >= 1 ? "circle active" : "circle"}>1</div>
                <span className="step-text">Claimant</span>
              </div>
              <div className="step-indicator">
                <div className={step >= 2 ? "circle active" : "circle"}>2</div>
                <span className="step-text">Consignment</span>
              </div>
              <div className="step-indicator">
                <div className={step >= 3 ? "circle active" : "circle"}>3</div>
                <span className="step-text">Bank Account</span>
              </div>
            </div>

            {step === 1 && (
              <div className="Input-Container">
                <div className="form-group-row">
                  <label
                    htmlFor="NameClaimant"
                    className="col-sm-4 col-form-label"
                  >
                    <span className="lb_IDCard">Name of Claimant</span>{" "}
                    <span className="required">*</span>
                  </label>
                  <div className="enterdata">
                    <input
                      type="text"
                      id="claim_username"
                      value={formData.claim_username}
                      onChange={handleChange}
                      placeholder="Name of Claiment"
                    />
                  </div>
                </div>
                <div className="form-group-row">
                  <label
                    htmlFor="PersonalID"
                    className="col-sm-4 col-form-label"
                  >
                    <span className="lb_IDCard">Thai ID/Passport</span>{" "}
                    <span className="required">*</span>
                  </label>
                  <div className="enterdata">
                    <input
                      type="text"
                      id="claim_userSSID"
                      value={formData.claim_userSSID}
                      onChange={handleChange}
                      placeholder="Thai ID/Passport"
                    />
                  </div>
                </div>
                <div className="form-group-row">
                  <label
                    htmlFor="Telephone"
                    className="col-sm-4 col-form-label"
                  >
                    <span className="Telephone">Phone Number</span>{" "}
                    <span className="required">*</span>
                  </label>
                  <div className="enterdata">
                    <input
                      type="telephone"
                      id="claim_usertel"
                      value={formData.claim_usertel}
                      onChange={handleChange}
                      placeholder="Phone Number"
                    />
                  </div>
                </div>
                <div className="form-group-row">
                  <label htmlFor="Email" className="col-sm-4 col-form-label">
                    <span className="email">Email</span>{" "}
                    <span className="required">*</span>
                  </label>
                  <div className="enterdata">
                    <input
                      type="email"
                      id="claim_email"
                      value={formData.claim_email}
                      onChange={handleChange}
                      placeholder="Email"
                    />
                  </div>
                </div>
                <br />
                <div className="text-next">
                  <button type="button" onClick={nextStep}>
                    <h2>Next</h2>
                  </button>
                </div>
              </div>
            )}
            {step === 2 && (
              <div className="Input-Container">
                <div className="form-group-row">
                  <label
                    htmlFor="NameClaimant"
                    className="col-sm-4 col-form-label"
                  >
                    <span className="lb_IDCard">Tracking No.</span>{" "}
                    <span className="required">*</span>
                  </label>
                  <div className="enterdata">
                    <input
                      type="text"
                      id="claim_parcelID"
                      value={formData.claim_parcelID}
                      onChange={handleChange}
                      placeholder="Tracking No."
                    />
                  </div>
                </div>
                <div className="form-group-row">
                  <label for="" className="col-sm-4 col-form-label">
                    <span className="lb_IDCard">Product Type </span>{" "}
                    <span className="required">*</span>
                  </label>
                  <div className="enterdata">
                    <select
                      id="selector"
                      value={formData.claim_type}
                      onChange={handleSelectChange}
                    >
                      <option value="0">fruits</option>
                      <option value="1">baby products</option>
                      <option value="2">clothing accessories</option>
                      <option value="3">cosmetic/beauty</option>
                      <option value="4">fresh food</option>
                      <option value="5">hand tools</option>
                      <option value="6">health</option>
                      <option value="7">kitchenware</option>
                      <option value="8">tree</option>
                      <option value="9">others</option>
                    </select>
                  </div>
                </div>
                <div className="form-group-row">
                  <label
                    htmlFor="Description"
                    className="col-sm-4 col-form-label"
                  >
                    <span className="lb_IDCard">Product Description</span>{" "}
                    <span className="required">*</span>
                  </label>
                  <div className="enterdata">
                    <input
                      type="text"
                      id="claim_des"
                      value={formData.claim_des}
                      onChange={handleChange}
                      placeholder="Desciption."
                    />
                  </div>
                </div>
                <br />
                <div className="text-prev1">
                  <button type="button" onClick={prevStep} className="prev">
                    <h2>Previous</h2>
                  </button>
                </div>
                <div className="text-next2">
                  <button type="button" onClick={nextStep}>
                    <h2>Next</h2>
                  </button>
                </div>
              </div>
            )}
            {step === 3 && (
              <div className="Input-Container">
                <div className="form-group-row">
                  <label htmlFor="selector" className="col-sm-4 col-form-label">
                    <span className="lb_IDCard">Bank Account</span>{" "}
                    <span className="required">*</span>
                  </label>
                  <div className="enterdata">
                    <select
                      id="selector"
                      value={formData.claim_bankaccount}
                      nChange={handleSelectChange}
                    >
                      <option value="0">Kasikorn Bank</option>
                      <option value="1">Krungthai Bank</option>
                      <option value="2">TMBThanachart Bank</option>
                      <option value="3">Krungsri Bank</option>
                      <option value="4">Bangkok Bank</option>
                      <option value="5">Citi Bank</option>
                      <option value="6">Others</option>
                    </select>
                  </div>
                  {formData.claim_bankaccount === "6" && (
                    <div className="form-group-row">
                      <label
                        htmlFor="otherBankAccount"
                        className="col-sm-4 col-form-label"
                      >
                        <span className="lb_IDCard">Other Bank Account</span>{" "}
                        <span className="required">*</span>
                      </label>
                      <div className="enterdata">
                        <input
                          type="text"
                          id="claim_bankaccount"
                          value={formData.claim_bankaccount}
                          onChange={handleChange}
                          placeholder="Name of Bank"
                        />
                      </div>
                    </div>
                  )}
                </div>
                <div className="form-group-row">
                  <label
                    htmlFor="bankAccountNumber"
                    className="col-sm-4 col-form-label"
                  >
                    <span className="lb_IDCard">Bank Account Number</span>{" "}
                    <span className="required">*</span>
                  </label>
                  <div className="enterdata">
                    <input
                      type="text"
                      id="claim_banknum"
                      value={formData.claim_banknum}
                      onChange={handleChange}
                      placeholder="Bank Account Number"
                    />
                  </div>
                </div>
                <div className="form-group-row">
                  <label
                    htmlFor="bankNameHolder"
                    className="col-sm-4 col-form-label"
                  >
                    <span className="lb_IDCard">
                      Full Name of Account Holder
                    </span>{" "}
                    <span className="required">*</span>
                  </label>
                  <div className="enterdata">
                    <input
                      type="text"
                      id="claim_bankholdername"
                      value={formData.claim_bankholdername}
                      onChange={handleChange}
                      placeholder="Full Name of Account Holder"
                    />
                  </div>
                </div>
                <br />
                <div className="text-prev2">
                  <button type="button" onClick={prevStep} className="prev">
                    <h2>Previous</h2>
                  </button>
                </div>
                <div className="text-submit">
                  <button type="submit" onClick={handleSubmit}>
                    <h2>Finish</h2>
                  </button>
                </div>
              </div>
            )}
          </form>
        </div>
      </div>
    </>
  );
};

export default Claim;
